        // Favicon generation logic
        class FaviconGenerator {
            constructor() {
                this.canvas = null;
                this.ctx = null;
                this.originalImage = null;
                this.generatedFiles = [];
                this.init();
            }

            init() {
                this.setupEventListeners();
                this.setupCanvas();
                document.getElementById('current-year').textContent = new Date().getFullYear();
            }

            setupCanvas() {
                this.canvas = document.createElement('canvas');
                this.ctx = this.canvas.getContext('2d');
            }

            setupEventListeners() {
                const uploadArea = document.getElementById('upload-area');
                const fileInput = document.getElementById('file-input');
                const generateBtn = document.getElementById('generate-btn');
                const downloadAllBtn = document.getElementById('download-all-btn');
                const newFaviconBtn = document.getElementById('new-favicon-btn');
                const copyCodeBtn = document.getElementById('copy-code-btn');
                const bgColorInput = document.getElementById('bg-color');
                const bgColorText = document.getElementById('bg-color-text');
                const transparentBg = document.getElementById('transparent-bg');
                const paddingSlider = document.getElementById('padding-slider');

                // Upload area events
                uploadArea.addEventListener('click', () => fileInput.click());
                uploadArea.addEventListener('dragover', this.handleDragOver.bind(this));
                uploadArea.addEventListener('dragleave', this.handleDragLeave.bind(this));
                uploadArea.addEventListener('drop', this.handleDrop.bind(this));

                // File input change
                fileInput.addEventListener('change', this.handleFileSelect.bind(this));

                // Generate button
                generateBtn.addEventListener('click', this.generateFavicons.bind(this));

                // Download all button
                downloadAllBtn.addEventListener('click', this.downloadAll.bind(this));

                // New favicon button
                newFaviconBtn.addEventListener('click', this.resetGenerator.bind(this));

                // Copy code button
                copyCodeBtn.addEventListener('click', this.copyHtmlCode.bind(this));

                // Color inputs sync
                bgColorInput.addEventListener('change', (e) => {
                    bgColorText.value = e.target.value;
                });
                bgColorText.addEventListener('input', (e) => {
                    if (/^#[0-9A-F]{6}$/i.test(e.target.value)) {
                        bgColorInput.value = e.target.value;
                    }
                });

                // Transparent background toggle
                transparentBg.addEventListener('change', (e) => {
                    const colorInputs = document.querySelector('#bg-color').parentElement;
                    colorInputs.style.opacity = e.target.checked ? '0.5' : '1';
                    colorInputs.style.pointerEvents = e.target.checked ? 'none' : 'auto';
                });

                // Padding slider
                paddingSlider.addEventListener('input', (e) => {
                    document.getElementById('padding-value').textContent = e.target.value;
                });

                // Initialize transparent background state (default is checked)
                const colorInputs = document.querySelector('#bg-color').parentElement;
                colorInputs.style.opacity = '0.5';
                colorInputs.style.pointerEvents = 'none';
            }

            handleDragOver(e) {
                e.preventDefault();
                e.currentTarget.classList.add('dragover');
            }

            handleDragLeave(e) {
                e.currentTarget.classList.remove('dragover');
            }

            handleDrop(e) {
                e.preventDefault();
                e.currentTarget.classList.remove('dragover');
                const files = e.dataTransfer.files;
                if (files.length > 0) {
                    this.processFile(files[0]);
                }
            }

            handleFileSelect(e) {
                const file = e.target.files[0];
                if (file) {
                    this.processFile(file);
                }
            }

            processFile(file) {
                if (!file.type.startsWith('image/')) {
                    alert('Please select a valid image file.');
                    return;
                }

                if (file.size > 10 * 1024 * 1024) {
                    alert('File size must be less than 10MB.');
                    return;
                }

                const isSvg = file.type === 'image/svg+xml' || file.name.toLowerCase().endsWith('.svg');

                if (isSvg) {
                    // Special handling for SVG files
                    const reader = new FileReader();
                    reader.onload = (e) => {
                        this.loadSvgImage(e.target.result);
                    };
                    reader.readAsText(file);
                } else {
                    const reader = new FileReader();
                    reader.onload = (e) => {
                        this.loadImage(e.target.result);
                    };
                    reader.readAsDataURL(file);
                }
            }

            loadSvgImage(svgText) {
                // Parse SVG to get dimensions from viewBox or width/height attributes
                const parser = new DOMParser();
                const svgDoc = parser.parseFromString(svgText, 'image/svg+xml');
                const svgElement = svgDoc.querySelector('svg');

                if (!svgElement) {
                    alert('Invalid SVG file.');
                    return;
                }

                // Get dimensions from viewBox or width/height
                let width = 512;
                let height = 512;

                const viewBox = svgElement.getAttribute('viewBox');
                if (viewBox) {
                    const parts = viewBox.split(/[\s,]+/);
                    if (parts.length >= 4) {
                        width = parseFloat(parts[2]) || 512;
                        height = parseFloat(parts[3]) || 512;
                    }
                }

                // Check for explicit width/height attributes
                const svgWidth = svgElement.getAttribute('width');
                const svgHeight = svgElement.getAttribute('height');
                if (svgWidth && svgHeight) {
                    width = parseFloat(svgWidth) || width;
                    height = parseFloat(svgHeight) || height;
                }

                // Ensure SVG has proper dimensions for rendering
                svgElement.setAttribute('width', width);
                svgElement.setAttribute('height', height);

                // Serialize back to string
                const serializer = new XMLSerializer();
                const modifiedSvgText = serializer.serializeToString(svgElement);

                // Use Data URL instead of Blob URL to avoid canvas taint
                const svgBase64 = btoa(unescape(encodeURIComponent(modifiedSvgText)));
                const svgDataUrl = 'data:image/svg+xml;base64,' + svgBase64;

                const img = new Image();
                img.onload = () => {
                    this.originalImage = img;
                    this.showPreview(svgDataUrl);
                };
                img.onerror = () => {
                    alert('Failed to load SVG image.');
                };
                img.src = svgDataUrl;
            }

            loadImage(src) {
                const img = new Image();
                img.onload = () => {
                    this.originalImage = img;
                    this.showPreview(src);
                };
                img.src = src;
            }

            showPreview(src) {
                document.getElementById('original-preview').src = src;
                document.getElementById('preview-section').classList.remove('hidden');
                document.getElementById('preview-section').scrollIntoView({ behavior: 'smooth' });
            }

            async generateFavicons() {
                if (!this.originalImage) return;

                this.showProgress();
                this.generatedFiles = [];

                const formats = [
                    { name: 'favicon.ico', size: 32, type: 'ico', description: 'Standard ICO format' },
                    { name: 'favicon-16x16.png', size: 16, type: 'png', description: '16x16 PNG' },
                    { name: 'favicon-32x32.png', size: 32, type: 'png', description: '32x32 PNG' },
                    { name: 'apple-touch-icon.png', size: 180, type: 'png', description: 'Apple Touch Icon' },
                    { name: 'android-chrome-192x192.png', size: 192, type: 'png', description: 'Android Chrome 192x192' },
                    { name: 'android-chrome-512x512.png', size: 512, type: 'png', description: 'Android Chrome 512x512' },
                ];

                const bgColor = document.getElementById('transparent-bg').checked ? 'transparent' : document.getElementById('bg-color').value;
                const padding = parseInt(document.getElementById('padding-slider').value);

                for (let i = 0; i < formats.length; i++) {
                    const format = formats[i];
                    const progress = ((i + 1) / formats.length) * 100;

                    this.updateProgress(progress, `Generating ${format.name}...`);

                    const blob = await this.generateFormat(format, bgColor, padding);
                    this.generatedFiles.push({
                        ...format,
                        blob,
                        url: URL.createObjectURL(blob)
                    });

                    await new Promise(resolve => setTimeout(resolve, 200));
                }

                this.hideProgress();
                this.showResults();
            }

            async generateFormat(format, bgColor, padding) {
                const { size, type } = format;

                this.canvas.width = size;
                this.canvas.height = size;

                this.ctx.clearRect(0, 0, size, size);

                if (bgColor !== 'transparent') {
                    this.ctx.fillStyle = bgColor;
                    this.ctx.fillRect(0, 0, size, size);
                }

                const paddingPx = (size * padding) / 100;
                const imageSize = size - (paddingPx * 2);

                const sourceSize = Math.min(this.originalImage.width, this.originalImage.height);
                const sourceX = (this.originalImage.width - sourceSize) / 2;
                const sourceY = (this.originalImage.height - sourceSize) / 2;

                this.ctx.drawImage(
                    this.originalImage,
                    sourceX, sourceY, sourceSize, sourceSize,
                    paddingPx, paddingPx, imageSize, imageSize
                );

                return new Promise(resolve => {
                    this.canvas.toBlob(resolve, 'image/png');
                });
            }

            showProgress() {
                document.getElementById('progress-container').classList.remove('hidden');
                document.getElementById('generate-btn').disabled = true;
                document.getElementById('generate-btn').textContent = 'Generating...';
            }

            updateProgress(percent, text) {
                document.getElementById('progress-fill').style.width = percent + '%';
                document.getElementById('progress-text').textContent = text;
            }

            hideProgress() {
                document.getElementById('progress-container').classList.add('hidden');
                document.getElementById('generate-btn').disabled = false;
                document.getElementById('generate-btn').textContent = 'Generate Favicons';
            }

            showResults() {
                const grid = document.getElementById('favicon-grid');
                grid.innerHTML = '';

                this.generatedFiles.forEach(file => {
                    const item = document.createElement('div');
                    item.className = 'format-item';
                    item.innerHTML = `
                        <img src="${file.url}" alt="${file.name}" class="w-16 h-16 mx-auto mb-2">
                        <p class="font-medium text-sm text-gray-900">${file.name}</p>
                        <p class="text-xs text-gray-500 mb-3">${file.description}</p>
                        <button onclick="faviconGenerator.downloadFile('${file.name}', '${file.url}')" class="bg-gray-800 text-white px-3 py-1 rounded text-xs hover:bg-gray-700 transition-colors">
                            Download
                        </button>
                    `;
                    grid.appendChild(item);
                });

                this.generateHtmlCode();
                document.getElementById('results-section').classList.remove('hidden');
                document.getElementById('new-favicon-btn').classList.remove('hidden');
                document.getElementById('results-section').scrollIntoView({ behavior: 'smooth' });
            }

            generateHtmlCode() {
                const code = `<!-- Favicon package generated by Favicon.im Converter -->
<link rel="icon" type="image/x-icon" href="/favicon.ico">
<link rel="icon" type="image/png" sizes="16x16" href="/favicon-16x16.png">
<link rel="icon" type="image/png" sizes="32x32" href="/favicon-32x32.png">
<link rel="apple-touch-icon" sizes="180x180" href="/apple-touch-icon.png">
<link rel="icon" type="image/png" sizes="192x192" href="/android-chrome-192x192.png">
<link rel="icon" type="image/png" sizes="512x512" href="/android-chrome-512x512.png">
<meta name="theme-color" content="#ffffff">`;

                document.getElementById('html-code').textContent = code;
            }

            async downloadAll() {
                const zip = new JSZip();

                this.generatedFiles.forEach(file => {
                    zip.file(file.name, file.blob);
                });

                const manifest = {
                    "name": "Your App Name",
                    "short_name": "Your App",
                    "icons": [
                        {
                            "src": "/android-chrome-192x192.png",
                            "sizes": "192x192",
                            "type": "image/png"
                        },
                        {
                            "src": "/android-chrome-512x512.png",
                            "sizes": "512x512",
                            "type": "image/png"
                        }
                    ],
                    "theme_color": "#ffffff",
                    "background_color": "#ffffff",
                    "display": "standalone"
                };
                zip.file("manifest.json", JSON.stringify(manifest, null, 2));

                const content = await zip.generateAsync({type: "blob"});
                this.downloadBlob(content, "favicons.zip");
            }

            downloadFile(filename, url) {
                const a = document.createElement('a');
                a.href = url;
                a.download = filename;
                a.click();
            }

            downloadBlob(blob, filename) {
                const url = URL.createObjectURL(blob);
                const a = document.createElement('a');
                a.href = url;
                a.download = filename;
                a.click();
                URL.revokeObjectURL(url);
            }

            copyHtmlCode() {
                const code = document.getElementById('html-code').textContent;
                navigator.clipboard.writeText(code).then(() => {
                    const btn = document.getElementById('copy-code-btn');
                    const originalText = btn.textContent;
                    btn.textContent = 'Copied!';
                    btn.classList.add('bg-green-600');
                    btn.classList.remove('bg-gray-800');
                    setTimeout(() => {
                        btn.textContent = originalText;
                        btn.classList.remove('bg-green-600');
                        btn.classList.add('bg-gray-800');
                    }, 2000);
                });
            }

            resetGenerator() {
                document.getElementById('preview-section').classList.add('hidden');
                document.getElementById('results-section').classList.add('hidden');
                document.getElementById('new-favicon-btn').classList.add('hidden');

                document.getElementById('file-input').value = '';
                document.getElementById('bg-color').value = '#ffffff';
                document.getElementById('bg-color-text').value = '#ffffff';
                document.getElementById('transparent-bg').checked = true;
                document.getElementById('padding-slider').value = '0';
                document.getElementById('padding-value').textContent = '0';

                this.generatedFiles.forEach(file => URL.revokeObjectURL(file.url));
                this.generatedFiles = [];
                this.originalImage = null;

                document.getElementById('upload-area').scrollIntoView({ behavior: 'smooth' });
            }
        }

        // Initialize the favicon generator
        const faviconGenerator = new FaviconGenerator();